import './index.css';

function Header() {
  return (
    <div>
      <div className='App'>
        <h2 className='normal'>SESSIONS</h2>
        <h2>MANAGE</h2>
        <h2 className='normal'>USER ADMIN</h2>
        <h3 className='normal'>Logout</h3>
      </div>
      <div className='bar'></div>
    </div>
  );
}

export default Header;
